import React, {useEffect, useState} from 'react';
import CommunityNav from "./CommunityComponents/CommunityNav";
import CommunityPost from "./CommunityComponents/CommunityPost";
import {Container, Row, Col, Card, Form, Button } from "react-bootstrap";
import { withRouter } from "react-router";
import { BrowserRouter as Router, Route} from "react-router-dom";

function Community (props){

	return(
		<div className="Community">
			<Container fluid>
                <Row>
                    <Col xs={2} id="sidebar-wrapper">      
                      <CommunityNav />
                    </Col>
                    <Col  xs={10} id="page-content-wrapper">
					<Router>
						<Route path="/community/communitypost" component={<CommunityBoard type="communitypost" />}></Route>
						<Route path="/community/feedbackpost" component={Community}></Route>
					</Router>
						
                    </Col> 
                </Row>

            </Container>
			
			
		</div>
	);
}
const Dashboard = withRouter(Community);
export default Community;
